import React from 'react';

const Profile = ({ profileData }) => {

    return (
        <div>
            <div className="awards-portfolio">
                <h3>프로필</h3>
                <div>
                    <p>{profileData.name}</p>
                    <p>{profileData.comments}</p>
                </div>
            </div>
        </div>
    );
    
}

export default Profile;
